function Home() {
    return (
        <div className="main">
            <h1>JUPÍÍÍ</h1>
            <div><img src="/images/xmas_tree_presents_no_bg.png" alt="Presents!" /></div>
            <div>
                <div className="end-rhyme"><h3>Paráda, si skoro tam. Poďme si ešte trochu zarýmovať!</h3></div>
                <div><h3><i>Keď sa Stanke realita ako GTA javí,</i></h3></div>
                <div><h3><i>šok sa na Samovej tvári zjaví.</i></h3></div>
                <div><h3><i>Obrubník, jama a či ostrá skala,</i></h3></div>
                <div><h3><i>tou cestou by ísť radšej nemala.</i></h3></div>
                <div><h3><i>Je dobré náhradu po ruke mať,</i></h3></div>
                <div className="end-rhyme"><h3><i>keď sa chce Stanka niekam presúvať.</i></h3></div>
            </div>
        </div>
    );
}

export default Home;
